import React, { Component } from "react";
import { Row } from "react-bootstrap";

export default class StartExamPage extends Component {
  state = {
    exam: {
      candidateName: "",
      name: "",
    },
  };

  async componentDidMount() {
    const url = "http://localhost:3007/exam/start";
    const opts = {
      methot: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(this.state.exam),
    };
    await fetch(url, opts)
      .then((res) => res.json())
      .then((data) =>
        this.setState({
          exam: data,
        })
      )
      .catch(console.error);
  }

  render() {
    return (
      <>
        <Row>
          <h1>This will be start exam page</h1>
        </Row>
        <Row>{this.state.map()}</Row>
      </>
    );
  }
}
